// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract SignalStorage {
    struct Signal {
        string coin;
        string action; // BUY, SELL, HOLD
        uint256 confidence; // 0-100
        uint256 entryPoint;
        uint256 stopLoss;
        uint256 takeProfit;
        string reasoning;
        uint256 timestamp;
        address submitter;
    }

    Signal[] public signals;
    mapping(string => Signal[]) public signalsByCoin;

    event SignalSubmitted(
        uint256 indexed signalId,
        string coin,
        string action,
        uint256 confidence,
        uint256 timestamp
    );

    event SentimentRecorded(string coin, string sentiment, uint256 timestamp);

    function submitSignal(
        string memory _coin,
        string memory _action,
        uint256 _confidence,
        uint256 _entryPoint,
        uint256 _stopLoss,
        uint256 _takeProfit,
        string memory _reasoning
    ) public returns (uint256) {
        Signal memory newSignal = Signal({
            coin: _coin,
            action: _action,
            confidence: _confidence,
            entryPoint: _entryPoint,
            stopLoss: _stopLoss,
            takeProfit: _takeProfit,
            reasoning: _reasoning,
            timestamp: block.timestamp,
            submitter: msg.sender
        });

        signals.push(newSignal);
        signalsByCoin[_coin].push(newSignal);

        uint256 signalId = signals.length - 1;

        emit SignalSubmitted(
            signalId,
            _coin,
            _action,
            _confidence,
            block.timestamp
        );

        return signalId;
    }

    function recordSentiment(
        string memory _coin,
        string memory _sentiment
    ) public {
        emit SentimentRecorded(_coin, _sentiment, block.timestamp);
    }

    function getSignal(uint256 _signalId) public view returns (Signal memory) {
        require(_signalId < signals.length, "Signal does not exist");
        return signals[_signalId];
    }

    function getSignalsByCoin(
        string memory _coin
    ) public view returns (Signal[] memory) {
        return signalsByCoin[_coin];
    }

    function getTotalSignals() public view returns (uint256) {
        return signals.length;
    }
}

