// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface IERC20 {
    function transfer(address to, uint256 amount) external returns (bool);
    function transferFrom(
        address from,
        address to,
        uint256 amount
    ) external returns (bool);
    function balanceOf(address account) external view returns (uint256);
}

contract TradeExecutor {
    struct Trade {
        uint256 tradeId;
        string symbol;
        string side; // BUY or SELL
        uint256 amount;
        uint256 price;
        uint256 timestamp;
        address trader;
        bool executed;
    }

    Trade[] public trades;
    mapping(address => Trade[]) public tradesByUser;

    uint256 public totalPnL;
    uint256 public totalTrades;

    event TradeExecuted(
        uint256 indexed tradeId,
        string symbol,
        string side,
        uint256 amount,
        uint256 price,
        address trader,
        uint256 timestamp
    );

    event AutoStopLoss(
        uint256 indexed tradeId,
        string symbol,
        uint256 stopPrice,
        uint256 timestamp
    );

    event RiskAlert(
        string symbol,
        string riskLevel,
        string message,
        uint256 timestamp
    );

    function executeTrade(
        string memory _symbol,
        string memory _side,
        uint256 _amount,
        uint256 _price
    ) public returns (uint256) {
        Trade memory newTrade = Trade({
            tradeId: trades.length,
            symbol: _symbol,
            side: _side,
            amount: _amount,
            price: _price,
            timestamp: block.timestamp,
            trader: msg.sender,
            executed: true
        });

        trades.push(newTrade);
        tradesByUser[msg.sender].push(newTrade);
        totalTrades++;

        emit TradeExecuted(
            newTrade.tradeId,
            _symbol,
            _side,
            _amount,
            _price,
            msg.sender,
            block.timestamp
        );

        return newTrade.tradeId;
    }

    function triggerAutoStopLoss(
        uint256 _tradeId,
        string memory _symbol,
        uint256 _stopPrice
    ) public {
        require(_tradeId < trades.length, "Trade does not exist");

        emit AutoStopLoss(_tradeId, _symbol, _stopPrice, block.timestamp);
    }

    function recordRiskAlert(
        string memory _symbol,
        string memory _riskLevel,
        string memory _message
    ) public {
        emit RiskAlert(_symbol, _riskLevel, _message, block.timestamp);
    }

    function getTrade(uint256 _tradeId) public view returns (Trade memory) {
        require(_tradeId < trades.length, "Trade does not exist");
        return trades[_tradeId];
    }

    function getUserTrades(address _user) public view returns (Trade[] memory) {
        return tradesByUser[_user];
    }

    function getTotalTrades() public view returns (uint256) {
        return totalTrades;
    }
}

